Em aditamento à solicitação de reserva de sala de aula e estrutura para a realização da SEMANA ENFAM, do 37º Curso Oficial de Formação Inicial de Magistrados, no período de 06 a 10/06/2022, solicitamos a reserva de uma 2ª sala de aula (sala 310), com a mesma estrutura da sala já reservada (sala 311) e com as cadeiras soltas.

Seguem as demandas constantes no e-mail abaixo, da ENFAM:

·        2 salas de aula, com capacidade para 27 alunos, com as cadeiras distribuídas em formato de “U”, computador, relógio de parede, caixa de som, projetor e tela de projeção;

·        2 salas para trabalhos em grupo (com mesas e cadeiras suficientes para a quantidade de alunos de cada sala);

·        Flip chat e/ou quadro branco com respectivos pincéis atômicos em cada sala de aula;

·        Crachás para os participantes(se possível);

·        Blocos e canetas;

·        Apresentador multimídia em cada sala (passador de slides);

·        Liberação da rede wireless; ou disponibilização de rede wi-fi ou modem para os formadores da Enfam;

·        Acesso ao youtube, facebook, prezi;

·        Notebook para registro de presença pelo sistema EducaEnfam: 1 em cada sala;

·        Cobertura jornalística e fotográfica do curso e divulgação no site da Escola;

·        Liberação de um servidor durante todo o evento para auxiliar com os equipamentos de informática;

·      Indicação de um responsável da equipe da escola que ficará encarregado de acompanhar a frequência eletrônica no programa EducaEnfam, informando os seguintes dados deles: nome, e-mail, telefone e cpf; 

·        Sala de apoio para a equipe da Enfam com computador, acesso à internet e impressora.

 

Solicitamos, outrossim, os serviços de copa, como café e água, e ainda o serviço de coffee break para o evento.

